function sumPrimes(num) {

  var sum = 0;

  var checkIfPrime = function(el){
    for(let i = 2; i <= Math.sqrt(el); i++){
      if( el % i === 0){
        return false;
      }
    }
    return num !== 1; 

  }


  for(let i = 2; i <= num; i++ ){
    if(checkIfPrime(i)){
      sum += i;
    }
  }
  return sum;
}

sumPrimes(10);
